    "cost-earnings-survey-of-nwhi-bottomfish-fleets-2003",nt"isopen": false,nt"url":
    null,nt"notes": "During May-August 2004, face-to-face interviews with owners
    and/or captains of all NWHI bottomfish vessels were conducted to collect primary
    information on costs of fishing operations in 2003.  Information on physical characteristics
    of the vessels, motivation of fishermen, and other topics was also collected.  Follow-up
    interviews were conducted in September 2004 and March-April 2005 to collect data
    missed during the first interviews.  M. Pan and A. Griesemer conducted the project.",nt"license_title":
